const Tasks = () => {
  const [tasks, setTasks] = useState([
    {
      id:1,
      text:'Print this again'
    },{
      id:2,
      text:'Print that'
    },
    {
      id:3,
      text:'And then Print this'
    }
  ]) 
  return (
    <>
    {tasks.map((task) => (
      <h3 key={task.id}> {task.text}</h3>
    ))}
    </>
  )
}

export default Tasks
